insert  into `outfit`(`id_outfit`,`id_user`,`id_kategori`,`id_gender`,`id_tahun`,`id_musim`,`id_tipe`,`id_style`,`warna`,`nama_outfit`,`harga_sewa`,`harga_beli`,`deskripsi`,`detail_produk`,`stock`) values 
(1,1,3,1,13,1,10,10,'Ivory, White','Merle Blouson Bridal Maxi Dress',900000,99900000,'Loose fitting and flowy, our Merle bridal dress is perfect for those who prefer a more bohemian style on their big day. Head-to-toe embellishments, her back is finished with a beautiful knot tie detail, making her equally as-pretty-as-comfortable.','Outer. 100% Recycled Polyester Lining. 100% Recycled Polyester\r\nL 170 cm\r\nmachine wash\r\nRecycled Polyester\r\nZip fastening\r\nVneck\r\nSHORT SLEEVES\r\nEMB\r\nWeight: 170 grams',2),
(2,2,3,1,13,1,10,10,'Ivory, White','Stephanie Embellished Bridal Dress',800000,5670000,'Fitting into the timeless, bohemian aesthetic we love here at Monsoon, the bodice of our Stephanie bridal dress is fashioned with embellished tulle and floaty angel sleeves. Beautifully sculpting the figure whilst complementing the intricate details in the bodice is a clean and simple maxi skirt, accompanied by a lightweight train.','Outer. 100% Recycled Polyester Lining. 100% Recycled Polyester',2),
(3,3,3,1,13,1,10,10,'Ivory, White','Tanja Floral Embroidered Bridal Dress',900000,80000000,'Tanja\'s flutter sleeves and flared skirt will ensure you feel like an angel on your special day. The delicate mesh is intricately detailed, with white flowers and pearly embellishments taking centre stage. Perfect for brides hesitant about a long train, Tanja\'s hem just gently sweeps the floor for a graceful, yet easy-to-wear finish.','Outer. 100% Recycled Polyester Lining. 100% Recycled Polyester\r\nmachine wash\r\nPolyester\r\nZip fastening\r\nVneck\r\nSHORT SLEEVES\r\nEMB\r\nWeight: 210 grams',2),
(4,3,3,1,13,1,10,10,'Ivory, White','Eve Embellished Bridal Maxi Dress',900000,80000000,'Fresh and floaty, our Eve bridal dress is adorned with delicate embellishments, making your special day even more perfect. The beautiful yet subtle flare on her skirt should skim the floor as you glide down the aisle, and can be altered by a seamstress for the perfect length.\r\n\r\nJust one of our steps towards a future for sustainable fashion, we introduce S.E.W: our commitment to using more eco-conscious materials in our ranges. This capsule collection is created using fabrics that are both kinde','Outer. 100% Recycled Polyester Lining. 100% Recycled Polyester\r\nmachine wash\r\nRecycled Polyester\r\nZip fastening\r\nVneck\r\nSLEEVELESS\r\nEMB\r\nWeight: 170 grams',2),
(5,3,3,1,13,1,10,10,'Ivory, White','Sophie Beaded Floral Bridal Dress',900000,80000000,'Intricate beading and a slim-cut silhouette make Sophie an effortlessly elegant choice for your special day. The floor-length style is created in sheer mesh with a soft sweetheart lining and fabric-covered buttons to fasten. At the back is a long, beautiful train that can be easily altered by a seamstress. Ivory','Outer. 100% Recycled Polyester Lining. 100% Recycled Polyester\r\ndry clean\r\nPolyester\r\nZip fastening\r\nRound neck\r\nSHORT SLEEVES\r\nEMB\r\nWeight: 210 grams',2),
(6,3,3,1,13,1,10,10,'Ivory, White','Kaley Embellished Square Neck Bridal Dress',900000,80000000,'Embellished beautifully throughout, our Kaley gown\'s profile is built with a square neck, slim waist and maxi skirt that falls softly into a flared finish. Choose her for an outdoors wedding setting and watch the sequins sparkle in the sunlight. Fastens on the reverse.','Outer. 100% Recycled Polyester Lining. 100% Recycled Polyester',2),
